import math

def main():
    n = int(input())
    for case in range(1, n+1):
        Hx, Hy, Kx, Ky = map(int, input().split())
        result = round(swap(Hx, Hy, Kx, Ky), 6)
        print("Case {}: {}".format(case, result))

def swap(Hx, Hy, Kx, Ky):
    if Ky/Kx > Hy/Hx:
        if Hx == Kx:
            if Ky > Hy:
                tHx = Kx
                tHy = Ky
                tKx = Hx
                tKy = Hy
                return solve(tHx, tHy, tKx, tKy)
            else:
                return solve(Hx, Hy, Kx, Ky)
        elif Hx > Kx:
            tHx = Kx
            tHy = Ky
            tKx = Hx
            tKy = Hy
            return solve(tHx, tHy, tKx, tKy)
        else:
            return solve(Hx, Hy, Kx, Ky)
    else:
        return solve(Hx, Hy, Kx, Ky)

def solve(Hx, Hy, Kx, Ky):
    x = ((Kx * Hy) - (Hx * Ky))/(Hy + Ky)
    y = ((Kx * Hy) - (Hx * Ky))/(Hx + Kx)
    return math.sqrt(Hx**2 + (Hy-y)**2) + math.sqrt((Kx-x)**2 + Ky**2) + math.sqrt(x**2 + y**2)

