	public static class ObjectTransform {
		Matrix3 cubeRotation = new Matrix3(new double[]{
				1, 0, 0,
				0, 1, 0,
				0, 0, 1
		});

		public Matrix3 getCubeRotation() {
			return cubeRotation;
		}

		public void addRotation(int x, int y) {
			double heading = Math.toRadians(x);
			Matrix3 headingTransform = new Matrix3(new double[] {
					Math.cos(heading), 0, -Math.sin(heading),
					0,1,0,
					Math.sin(heading), 0, Math.cos(heading)
			});

			double pitch = Math.toRadians(y);
			Matrix3 pitchTransform = new Matrix3(new double[] {
					1, 0, 0,
					0, Math.cos(pitch), Math.sin(pitch),
					0, -Math.sin(pitch), Math.cos(pitch)
			});

			cubeRotation = cubeRotation.multiply(headingTransform.multiply(pitchTransform));
		}
	}

