		{
			CameraPoints ??= GetComponent<CameraPoints>();
			PreviewComponent ??= GetComponentInChildren<PreviewComponent>();
			_aiControl ??= GetComponentInChildren<MAnimalAIControl>(true);
			_input ??= GetComponent<MalbersInput>();
